-- ----------------------------
-- Table structure for t_account_payment_chk
-- ----------------------------
DROP TABLE IF EXISTS `t_account_payment_chk`;
CREATE TABLE `t_account_payment_chk` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `channel_name` varchar(36) DEFAULT NULL COMMENT '支付渠道名称',
  `channel_id` char(24) DEFAULT NULL COMMENT '支付渠道ID',
  `fund_type` int(1) DEFAULT NULL COMMENT '款单种类  1（收款）,2（退款）',
  `check_order` varchar(100) DEFAULT NULL COMMENT '对账用流水号',
  `pay_amount` decimal(10,2) DEFAULT NULL COMMENT '支付渠道金额',
  `recipt_amount` decimal(10,2) DEFAULT NULL COMMENT '收款渠道金额',
  `check_result` char(4) DEFAULT NULL COMMENT '对账结果 0（未对账）,1（对账相符），2（稽查）',
  `pay_date` datetime DEFAULT NULL COMMENT '支付交易日',
  `store_name` varchar(20) DEFAULT NULL COMMENT '门店名称',
  `eshop_name` varchar(20) DEFAULT NULL COMMENT 'E店名称',
  `provider_name` varchar(100) DEFAULT NULL COMMENT '供应商名称',
  `self` varchar(10) DEFAULT NULL COMMENT '是否自营（否:no；是:yes，代开:behalf）',
  `pay_platform` varchar(16) DEFAULT NULL COMMENT '支付平台',
  `comment` varchar(100) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `index_key` (`fund_type`,`check_order`),
  KEY `index_check_order` (`check_order`),
  KEY `index_fund_type` (`fund_type`),
  KEY `index_pay_date` (`pay_date`),
  KEY `index_check_result` (`check_result`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付渠道对账表';

-- ----------------------------
-- Records of t_account_payment_chk
-- ----------------------------

-- ----------------------------
-- Table structure for t_account_receipt_chk
-- ----------------------------
DROP TABLE IF EXISTS `t_account_receipt_chk`;
CREATE TABLE `t_account_receipt_chk` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `channel_name` varchar(36) DEFAULT NULL COMMENT '收款渠道名称',
  `channel_id` char(50) DEFAULT NULL COMMENT '收款渠道ID',
  `relation_id` varchar(100) NOT NULL COMMENT '关系id',
  `source` int(1) DEFAULT NULL COMMENT '数据来源 1（平台数据） 2（微超）',
  `fund_type` int(1) NOT NULL COMMENT '款单种类  1（收款）,2（退款）',
  `check_order` varchar(100) DEFAULT NULL COMMENT '对账用流水号',
  `pay_amount` decimal(10,2) DEFAULT NULL COMMENT '收款渠道金额',
  `recipt_amount` decimal(10,2) DEFAULT NULL COMMENT '支付渠道金额',
  `check_result` char(4) DEFAULT NULL COMMENT '对账结果 0（未对账）,1（对账相符），2（稽查）',
  `status` varchar(7) DEFAULT NULL COMMENT '收款交易状态',
  `receipt_date` datetime DEFAULT NULL COMMENT '收款交易时间',
  `store_name` varchar(20) DEFAULT NULL COMMENT '门店名称',
  `eshop_name` varchar(20) DEFAULT NULL COMMENT 'E店名称',
  `provider_name` varchar(100) DEFAULT NULL COMMENT '供应商名称',
  `self` varchar(10) DEFAULT NULL COMMENT '是否自营（否:no；是:yes，代开:behalf）',
  `pay_platform` varchar(16) DEFAULT NULL COMMENT '支付平台 (''cash'',''wx'',''alipay'',''alipay_qr'',''wx_pub_qr'',''arrear'',''prepay'',''pos'',''wx_pub'',''alipay_wap'',''gapay'',''alipay_pc_direct'',''check'',''score'')',
  `comment` varchar(100) DEFAULT NULL COMMENT '备注',
  `eshop_id` varchar(36) DEFAULT NULL COMMENT 'e店id',
  `platform_id` varchar(50) DEFAULT NULL,
  `merge_flag` varchar(30) DEFAULT NULL COMMENT '合并标识',
  `order_sn` varchar(32) DEFAULT NULL COMMENT '订单编号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `index_key` (`fund_type`,`check_order`),
  KEY `index_check_order` (`check_order`),
  KEY `index_fund_type` (`fund_type`),
  KEY `index_relation_id` (`relation_id`) USING BTREE,
  KEY `index_check_result` (`check_result`),
  KEY `index_receipt_date` (`receipt_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='收款渠道对账表';

